import React from "react";
import { Component } from "react-dom";

class NavigationBar extends Component {
  state = {};
  render() {
    return (
      <div className="navigation-bar">
        <button id="home" type="button" onClick="">
          Home
        </button>
        <button id="latest" type="button" onClick="">
          Latest
        </button>
        <button id="popular" type="button" onClick="">
          Popular
        </button>
        <button id="trending" type="button" onClick="">
          Trending
        </button>
        <button id="deals" type="button" onClick="">
          Deals
        </button>
      </div>
    );
  }
}

export default NavigationBar;
